import { Box, Container, Grid, Paper } from '@material-ui/core';
import React, { useEffect } from 'react';
import ExpensesPerMonthLineDiagram from '../Diagrams/ExpensesPerMonthLineDiargam';
import TopicPercentsDiagram from '../Diagrams/TopicPercentsDiagram';

const StatisticPage:React.FC = () => {

    return(
        <React.Fragment>
            <Container className="contentDiv" maxWidth="md" style={{padding: 16}}>
                 <Grid container justify="center" style={{margin:40}} spacing={4}>
                    <Grid item xs={8}>
                        <Paper elevation={15}>
                            <ExpensesPerMonthLineDiagram />
                        </Paper>
                    </Grid>
                    <Grid item xs={8}>
                        <Paper elevation={15}>
                            <TopicPercentsDiagram />
                        </Paper>
                    </Grid>
                    <Grid item xs={8}>
                        <Paper elevation={15}>
                            <TopicPercentsDiagram />
                        </Paper>
                    </Grid>
                 </Grid>
            </Container>
        </React.Fragment>
    );
}

export default StatisticPage;
